import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
const NotFound = () => {
  return (
    <div>
      <h1>404 - Page Not Found</h1>
      <p>The page you're looking for doesn't exist.</p>
    </div>
  );
};

export default NotFound;
